    <div className= "App">
    <Table striped bordered hover>
  <thead>
    <tr>
      <th>#</th>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Email</th>
      <th>Phone Number</th>

      <th>Date of Birth</th>
    </tr>
  </thead>
  <tbody>
  {props.results.map(element => (
  <Row
  firstName = {element.name.first}
  lastName = {element.name.last}
  email = {element.email}


  />   
      ))}

  </tbody>
</Table>
</div>
  );
}


